import logo from "./logo.svg";
import "./App.css";
import Account from "./component/Account";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Account />
      <Routes>
        <Route to="/" element={<Account />}></Route>
      </Routes>
    </>
  );
}

export default App;
